import {StyleSheet} from "react-native";

const styles = StyleSheet.create({
    container: {
        flex: 1,
        display: "flex",
        flexDirection: "row",
        height: 70,
        justifyContent: "space-between",
        paddingRight: 10,
        paddingLeft: 10,
        borderColor: 'black',
        textAlignVertical: "center",
        borderWidth: 1
    },

    nom: {
        alignItems: "center",
        height: 70,
        alignSelf: "center"
    },

    icon: {
        height: 70,
        alignSelf: "center"
    }
})

export default styles;
